import React from "react";
import FilterVintageIcon from '@mui/icons-material/FilterVintage';

function Header() {
  return (
    <header>
      <h1>
      <FilterVintageIcon className="icon1"fontSize="large" />
      <FilterVintageIcon className="icon2" /> 
      Save a note
      <FilterVintageIcon className="icon2"  />
      <FilterVintageIcon className="icon1" />
      </h1>
    </header>
  );
}

export default Header;
